import {Link } from 'react-router-dom'
import { Topography, Card, CardContent, CardMedia } from "@mui/material";
import { checkcircle } from "@mui/icons-material";
import {demoThumbnailUrl, demoVideoUrl,demoProfilePicture,demoVideoTitle, demoChannelTitle, demoChannelUrl} from '../Utils/constants.js'

const VideoCard = () => {
  const VideoCard = ({video: {id: {videoId}, snippet}})=>{
  return (
    <Card>
      <Link to={videoId ? `/video/${videoId}`: demoVideoUrl}>
      <CardMedia 
      image={snippets?.humbnails?.high?.url}
      alt={snippet?.title}
      sx={{width:358, height:180}}
      /> 
      </Link>
    </Card>
  )
}}

export default VideoCard
